using Microsoft.EntityFrameworkCore;

namespace MagnificentSuperHeroes.Server.Data
{
    public class DataContext : DbContext
    {
        public DataContext(DbContextOptions options) : base(options)
        {

        }

        protected override void OnModelCreating(ModelBuilder modelBuilder)
        {
            modelBuilder.Entity<Comic>().HasData(
               new Comic { Id = 1, Name = "Marvel" },
               new Comic { Id = 2, Name = "DC" }
               );


            modelBuilder.Entity<Team>().HasData(
               new Team { Id = 1, Name = "Avengers" },
            new Team { Id = 2, Name = "Justice League" }
               );


            modelBuilder.Entity<Difficulty>().HasData(

            new Difficulty { Id = 1, Title = "Easy" },
            new Difficulty { Id = 2, Title = "Normal" },
            new Difficulty { Id = 3, Title = "Hard" }
               );

            modelBuilder.Entity<SuperHero>().HasData(
                new SuperHero
                {
                    Id = 1,
                    Name = "Peter Parker",
                    HeroName = "Spiderman",
                    Bio = "American teenager Peter Parker, a poor sickly orphan, is bitten by a radioactive spider." +
                    " As a result of the bite, he gains superhuman strength," +
                    " speed, and agility, along with the ability to cling to walls, turning him into Spider-Man.",
                    BirthDate = new DateTime(2001, 8, 10),
                    TeamId = 1,
                    DifficultyId = 2,
                    IsReadyToFight = true,
                    ComicId = 1,
                    Image = "data:image/png;base64,"

                },
            new SuperHero
            {
                Id = 2,
                Name = "Bruce Wayne",
                HeroName = "Batman",
                Bio = "Batman is the superhero protector of Gotham City, a tortured, brooding vigilante dressed" +
                " as a bat who fights against evil and strikes fear into the hearts of criminals everywhere. In his public" +
                " identity, he is Bruce Wayne, a billionaire industrialist and notorious playboy",
                BirthDate = new DateTime(1964, 2, 19),
                TeamId = 1,
                DifficultyId = 2,
                IsReadyToFight = true,
                ComicId = 1,
                Image = "data:image/png;base64,"

            }
                );
        }
        public DbSet<SuperHero> SuperHeroes { get; set; }
        public DbSet<Comic> Comics { get; set; }

        public DbSet<Team> Teams { get; set; }

        public DbSet<Difficulty> Difficulties { get; set; }
    }
}

